import App from "./App";

function DogList() {
  return (
    <>
      <h1>DOGS</h1>
      <nav>
        <a href="/dogs/whiskey">Whiskey</a>
        <br></br>
        <a href="/dogs/duke">Duke</a>
        <br></br>
        <a href="dogs/perry">Perry</a>
      </nav>
    </>
  );
}

export default DogList;
